package com.ks.core

import android.content.Context
import android.util.Base64
import android.util.Log
import dalvik.system.DexClassLoader
import java.io.File

fun log(msg: String) {
    Log.d("wyz", msg)
}

object DexHelper {
    val dexBase64=""
    var dexClassLoader: DexClassLoader? = null

    fun loadDex(context: Context) {
        log("开始加载")
        if (dexClassLoader != null) return
        val bytes = Base64.decode(dexBase64, Base64.NO_WRAP)
        val parentFile = context.getExternalFilesDir("dex")!!;
        parentFile.mkdirs()
        val dexFile = File(
            parentFile.absolutePath,
            "${System.currentTimeMillis()}.dex"
        )
        dexFile.writeBytes(bytes)
        dexClassLoader = DexClassLoader(
            dexFile.absolutePath,
            parentFile.absolutePath,
            parentFile.absolutePath,
            context.classLoader
        )
        log("Dex加载成功!")
    }

    @JvmStatic
    fun loadClass(className: String): Class<*> {
        return dexClassLoader!!.loadClass(className)
    }

}